const Contact = () => {
  return (
    <div className='contect'>
      <h1 style={{color:"yellowgreen"}}>For any questions please drop a mail</h1> <br />  
      <h1 style={{color:"blue"}}>akp1081@gmail.com</h1> <br />
      <p>or</p> <br />
      <h1 style={{color:"blue"}}>8810300068</h1>
    </div>
  )
}

export default Contact
